import React from 'react';
import { Button, Typography, Box } from '@mui/material';
import { useNavigate } from 'react-router-dom';

const TimetableManagement = () => {
    const navigate = useNavigate();

    const handleEditTimetable = () => {
        navigate('/timetable-form'); // Redirect to TimetableForm for editing
    };

    return (
        <Box sx={{ padding: 2 }}>
            <Typography variant="h6" gutterBottom>Timetable Management</Typography>
            <Typography variant="body1" gutterBottom>
                You can manage your timetable by editing subjects for each hour.
            </Typography>
            <Button
                variant="contained"
                color="primary"
                onClick={handleEditTimetable}
            >
                Edit Timetable
            </Button>
        </Box>
    );
};

export default TimetableManagement;
